import React, { useState } from "react";
import "../css/Header.scss";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  Nav,
  NavItem,
  NavLink,
  Container,
  Row,
  Col
} from "reactstrap";

function Header() {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
    <div id="menu">
      <header>
        <Row>
          <Col sm="12" md="12" lg="12">
            <Navbar className="navbar-inverse bg-primary" toggleable>
              <NavbarToggler right onClick={this.toggle} />
              <NavbarBrand href="/">Сервис отклонений</NavbarBrand>
              <Collapse isOpen={this.state.isOpen} navbar>
                <Nav navbar>
                  <NavItem>
                    <NavLink href="/comments">Комментарии</NavLink>
                  </NavItem>
                  <NavItem>
                    <NavLink href="/report">Статистика</NavLink>
                  </NavItem>
                </Nav>
              </Collapse>
            </Navbar>
          </Col>
        </Row>
      </header>
    </div>
  );
}

export default Header;
